INSERT INTO `posts` VALUES
    (1, 'Who Else Is Lying To Us About twerking? ', '\r\n<p><b>One morning, when Gregor Samsa woke from troubled dreams, he found himself transformed in his bed into a horrible vermin.\r\nHe lay on his armour-like back, and if he lifted his head a little he could see his brown belly, slightly domed and divided\r\nby arches into stiff sections.</b><p>\r\n<p>The bedding was hardly able to cover it and seemed ready to slide off any moment. His many\r\nlegs, pitifully thin compared with the size of the rest of him, waved about helplessly as he looked.</p>\r\n<p>\"How about if I sleep a little bit longer and forget all this nonsense\", he thought, but that was something he was unable\r\nto do because he was used to sleeping on his right, and in his present state couldn\'t get into that position. However hard\r\nhe threw himself onto his right, he always rolled back to where he was.</p>\r\n<ul>\r\n\t<li>Bananas</li>\r\n\t<li>Apples</li>\r\n\t<li>Mangos</li>\r\n\t<li>Kiwis</li>\r\n\t<li>Dates</li>\r\n\t<li>Oranges</li>\r\n</ul>\r\n<p>He must have tried it a hundred times, shut his eyes so that he wouldn\'t have to look at the floundering legs, and only\r\nstopped when he began to feel a mild, dull pain there that he had never felt before. \"Oh, God\", he thought, \"what a strenuous\r\n career it is that I\'ve chosen! Travelling day in and day out.</p>\r\n<ol>\r\n\t<li>Bananas</li>\r\n\t<li>Apples</li>\r\n\t<li>Mangos</li>\r\n\t<li>Kiwis</li>\r\n\t<li>Dates</li>\r\n\t<li>Oranges</li>\r\n</ol>\r\n<h2>What about the children?</h2>\r\n<p>\"How about if I sleep a little bit longer and forget all this nonsense\", he thought, but that was something he was unable\r\nto do because he was used to sleeping on his right, and in his present state couldn\'t get into that position. However hard he\r\nthrew himself onto his right, he always rolled back to where he was.</p>\r\n<p>He must have tried it a hundred times, shut his eyes so that he wouldn\'t have to look at the floundering legs, and only\r\nstopped when he began to feel a mild, dull pain there that he had never felt before. \"Oh, God\", he thought, \"what a strenuous\r\ncareer it is that I\'ve chosen!</p>\r\n<p>Travelling day in and day out. Doing business like this takes much more effort than doing your own business at home, and\r\non top of that there\'s the curse of travelling, worries about making train connections, bad and irregular food, contact with\r\ndifferent people all the time so that you can never get to know anyone or become friendly with them.</p>\r\n<p>\" He felt a slight itch up on his belly; pushed himself slowly up on his back towards the headboard so that he could lift\r\nhis head better; found where the itch was, and saw that it was covered with lots of little white spots which he didn\'t know\r\nwhat to make of; and when he tried to feel the place with one of his legs he drew it quickly back because as soon as he touched\r\nit he was overcome by a cold shudder. He slid back into his former position.</p>', '2016-05-09 20:33:19'),
