stopped when he began to feel a mild, dull pain there that he had never felt before. \"Oh, God\", he thought, \"what a strenuous\r\ncareer it is that I\'ve chosen!</p>\r\n<p>Travelling day in and day out. Doing business like this takes much more effort than doing your own business at home, and\r\non top of that there\'s the curse of travelling, worries about making train connections, bad and irregular food, contact with\r\ndifferent people all the time so that you can never get to know anyone or become friendly with them.</p>\r\n<p>\" He felt a slight itch up on his belly; pushed himself slowly up on his back towards the headboard so that he could lift\r\nhis head better; found where the itch was, and saw that it was covered with lots of little white spots which he didn\'t know\r\nwhat to make of; and when he tried to feel the place with one of his legs he drew it quickly back because as soon as he touched\r\nit he was overcome by a cold shudder. He slid back into his former position.</p>', '2016-05-09 20:33:19'),
